Two octaves of $\mathcal{T}_5(100)$ together with $\Delta_5$ defined in Example \ref{EX.5-EDO with 100}.

\begin{figure}[h]
    \centering
    \begin{tikzpicture}[scale=1.2]
        % Draw the x-axis and y-axis
        \draw[->] (-0.5,0) -- (7.5,0) node[right] {Hz};
        \draw[->] (0,-0.2) -- (0,0.3);

        % Labels for the x-axis
        \foreach \x/\label in {1/100, 2/120, 3/140, 4/160, 5/180, 6/200, 7/240, 8/280, 9/320, 10/360, 11/400}
            \draw (\x, -0.2) node[below, font=\footnotesize] {$\x$} -- ++(0, 0.1) node[below right, font=\footnotesize] {\label};

        % Labels for the y-axis
        \node[above] at (3.5, 0.25) {$\left(v_{k+1,0}\right)$};
        \foreach \x/\label in {1/v_{k,0}, 2/v_{k,1}, 3/v_{k,2}, 4/v_{k,3}, 5/v_{k,4}, 6/v_{k,5}, 7/v_{k+1,1}, 8/v_{k+1,2}, 9/v_{k+1,3}, 10/v_{k+1,4}, 11/v_{k+1,5}}
